  false,\n\t\"url\": null,\n\t\"notes\": \"The Mentasta caribou herd is located in
  southeast mainland Alaska and Western Yukonn Territory. This small herd has declined
  from a high Of approximately 3,100 animals in 1985 to less than 900 in 1994. During
  winter the Mentasta he rd oft en intermingles with the larger Nelchina caribou herd
  which currently number s about 45,000 animals and has ranged f r om 5,000 t o 70,000
  animals. In winter this comb i ned herd may cross s t ate, native, private, and
  federal conservation unit boUndaries, as well as the international boundary with
  Canada. This plan is a cooperative effor t by The Alaska Department of Fish and
  Came (ADF'C), The U. S. National Par k Service (NPS) , and the U. S. Fish and Wildlife
  Service (FWS) to adopt management guidelines that reflect t he varied feder al a
  nd state policies and laws concerning management of the Mentasta caribou herd.\",\n\t\"license_title\":
